  "Initiated By" : "State on New York, Department of Financial Services",
  "Allegations" : "Violation of section of 2110(a)(2)of the NY Insurance Law. Representative failed to disclose to the state of NY a previous Regulatory action taken by the state of Alabama.",
  "Resolution" : "Stipulation and Consent",
  "SanctionDetails" : [ {
    "Sanctions" : "Monetary Penalty other than Fines"
  } ],
  "Sanctions" : "None",
  "Broker Comment" : "Upon applying for the 2015 renewal of a New York non-resident license, the NY Department of Finance found that agent had not disclosed a $50 fine imposed by the state of Alabama back in 2007 for failure to provide notice of a change of address.  Said proceeding and a detailed explanation as to how and why this failure occurred had been uploaded to the NIPR data base and the state of NY had been provided copies of it in 2012 when they renewed agent's NY non-resident license at that time.  Regardless of the 2012 license renewal action and in order to renew agent's NY license for 2015-2017, the NY Department of Finance cited retroactive non-compliance with certain NY regulations and required the execution of a Stipulation along with payment of a fine for failure to disclose said 2007 Alabama proceedings. In response to the inquiry imposed by the NY Department of Finance, agent responded with the explanation that there was never a deliberate intent to not disclose the Alabama proceeding, but any failure to disclose was the result of an administrative error and misunderstanding of the standard NIPR renewal questionnaire and the judicial vs. administrative actions taken in 2007 by the state of Alabama. As a result, Agent executed the attached Stipulation and paid the imposed fine.  The NY license was renewed and is effective until February 5, 2017."
}

